export const getColorThemes = themeGroup => {
  return themes[themeGroup]
}

export const getColorTheme = (themeGroup, themeKey) => {
  return themes[themeGroup].find(ct => ct.key === themeKey)
}

export const applyColorTheme = (themeGroup, themeKey, templateStr) => {
  let str = templateStr
  if (themeGroup) {
    let themeColors = themes[themeGroup].find(ct => ct.key === themeKey)
    if (themeColors) {
      if (themeColors.colors) {
        for (let key in themeColors.colors) {
          str = str.replace(
            new RegExp('\\$\\{theme\\.' + key + '\\}', 'g'),
            themeColors.colors[key]
          )
        }
      } else if (themeColors.svg) {
        return themeColors.svg
      }
    }
  }
  return str
}
